import React, { useEffect } from "react";

export default function GetAllSubnets(ac) {
  const APIbody = {
    "X-Cisco-Meraki-API-Key": `${ac.dc.apiKey}`,
    organizationId: `${ac.dc.organizationID}`,
    networkId: `${ac.dc.networkID}`,
  };

  useEffect(() => {
    fetch("/vlans", {
      method: ["POST"],
      cache: "no-cache",
      headers: {
        content_type: "application/json",
      },
      body: JSON.stringify(APIbody),
    }).then((response) => {
      return response.json;
    });
    fetch("/vlans")
      .then((res) => res.json())
      .then((vlans) => {
        console.log("GetAllSubnets -> vlans", vlans);
        console.log("GetAllSubnets -> subnet", vlans.subnet);
        console.log("GetAllSubnets -> Vlanid", vlans.id);
        // ac.dc.setclientList(client.devices);
      });
  }, [ac.dc.networkID]);
  return <div></div>;
}
